var content_f21_7_21617=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1124px;\">",
"  <div class=\"videoplayer\" h264=\"./images/EM/82898/Biceps_tend_palp_tech_video.mp4?title=Biceps+tendon+palpation+technique\" style=\"width:480px;height:288px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Technique for biceps tendon palpation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 295px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    To&nbsp;palpate the biceps tendon,&nbsp;identify the greater tubercle of the humerus and then move your fingers slightly medially into the bicipital groove. The shoulder can then be externally and internally rotated while feeling the biceps tendon roll under&nbsp;your fingers. At this point, extending and flexing the elbow allows for appreciation of tendon movement, and crepitus if present.&nbsp;",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Stephen Simons, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
