" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Overview of endometrial carcinoma",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?21/7/21624/contributors\">",
